import React from 'react';
//App.js에서 Weeks를 호출해오기 //./는 내가 현재있는 경로에서 ~ //.js는 생략해도 됨!
import Weeks from './Weeks';
import "./style.css";
import StarPage from './StarPage';
import {Route} from "react-router-dom";


//힘수형 컴포넌트
function App() {
  //요일 이름은 state해옴
  const [name, setName] = React.useState("일요일");

  return (
    <div className="App">
      <div className='container'>
        <Route path="/" exact>
          <h3>내 일주일은?</h3>
          <Weeks />
        </Route>
        <Route path="/Starpage">
          <StarPage name={name}/>
        </Route>
      </div>
    </div>
  );
}


export default App;
